void CFA1_decode_instr(uint32_t instr, uint16_t &addr1, uint16_t &addr2, 
	uint16_t &addr3, uint8_t &op_code)
{
	op_code = instr >> 30;
	addr1 = (instr >> 20) & 0x3FF;
	addr2 = (instr >> 10) & 0x3FF;
	addr3 = instr & 0x3FF;
}

void CFA1_core(CFA1_DATA_TYPE_INTERNAL tmp1[CFA1_NUM_REGS], CFA1_DATA_TYPE_INTERNAL tmp2[CFA1_NUM_REGS], const uint32_t instr[CFA1_ISTR], const int num_outputs) 
{	
	// initialized used constants

	tmp1[36] = 0.5;
	tmp2[36] = 0.5;
	tmp1[37] = 1.5;
	tmp2[37] = 1.5;
	tmp1[38] = 3.0;
	tmp2[38] = 3.0;

	for(int i = 0; i < CFA1_ISTR; i++) {
		#pragma HLS PIPELINE
		#pragma HLS DEPENDENCE variable=tmp1 inter false
		#pragma HLS DEPENDENCE variable=tmp2 inter false
		uint16_t addr1, addr2, addr3;
		uint8_t op;
		CFA1_decode_instr(instr[i], addr1, addr2, addr3, op);

		CFA1_DATA_TYPE_INTERNAL v;
		switch(op) {
			case 0:
				v = tmp1[addr1]*tmp2[addr2];
				tmp1[addr3] = v;
				tmp2[addr3] = v;
				break;
			case 1:
				v = tmp1[addr1]+tmp2[addr2];
				tmp1[addr3] = v;
				tmp2[addr3] = v;
				break;
			case 2:
				v = tmp1[addr1]-tmp2[addr2];
				tmp1[addr3] = v;
				tmp2[addr3] = v;
				break;
		}
	}
}

void CFA1_write_back(CFA1_DATA_TYPE_INTERNAL tmp1[CFA1_NUM_CORES][CFA1_NUM_REGS], hls::stream<CFA1_DATA_TYPE_OUT> &out)
{
#pragma HLS INLINE off
	for(int j = 0; j < CFA1_NUM_CORES; j++) {
		#pragma HLS UNROLL
		for(int i = 0; i < CFA1_cores_num_outputs[j]; i++) {
			#pragma HLS UNROLL
			out.write(tmp1[j][CFA1_ISTR + CFA1_IN_SIZE + CFA1_CONSTS + i]);
		}
	}
}

void dataRead(double tmp1[CFA1_NUM_CORES][CFA1_NUM_REGS],
		double tmp2[CFA1_NUM_CORES][CFA1_NUM_REGS],
		hls::stream<CFA1_DATA_TYPE_IN>& in) {
#pragma HLS INLINE off
	for (int i = 0; i < CFA1_IN_SIZE; i++) {
#pragma HLS PIPELINE
		double in_val = in.read();
		for (int j = 0; j < CFA1_NUM_CORES; j++) {
			tmp1[j][i] = in_val;
			tmp2[j][i] = in_val;
		}
	}
}

void CFA1_multiCore(hls::stream<CFA1_DATA_TYPE_IN> &in, hls::stream<CFA1_DATA_TYPE_OUT> &out)
{
	CFA1_DATA_TYPE_INTERNAL tmp1[CFA1_NUM_CORES][CFA1_NUM_REGS];
	CFA1_DATA_TYPE_INTERNAL tmp2[CFA1_NUM_CORES][CFA1_NUM_REGS];

	#pragma HLS ARRAY_PARTITION variable=CFA1_cores_instr complete dim=1
	#pragma HLS ARRAY_PARTITION variable=CFA1_cores_num_outputs complete dim=1
	#pragma HLS ARRAY_PARTITION variable=tmp1 complete dim=1
	#pragma HLS ARRAY_PARTITION variable=tmp2 complete dim=1

	#pragma HLS RESOURCE variable=tmp1 core=RAM_S2P_BRAM
	#pragma HLS RESOURCE variable=tmp2 core=RAM_S2P_BRAM

	dataRead(tmp1, tmp2, in);	

	for(int j = 0; j < CFA1_NUM_CORES; j++) {
		#pragma HLS UNROLL
		CFA1_core(tmp1[j], tmp2[j], CFA1_cores_instr[j], CFA1_cores_num_outputs[j]);
	}

	CFA1_write_back(tmp1, out);
}
